import React from 'react';
import AddToTeam from './AddToTeam';

const PokemonCard = ({ pokemon }) => {
  return (
    <div>
      <h3>{pokemon.name}</h3>
      <AddToTeam pokemon={pokemon} />
    </div>
  );
};

export default PokemonCard;
